import React from "react";

function About() {
  return (
    <div>
      <h1>WhoAm I ?</h1>
      <p>
        Im a React Front-End Developer.
        <br /> I create reponsive and secure <br />
        websites.
      </p>
      <button>Resume</button>
    </div>
  );
}

export default About;
